import style from "./Recipe.module.css"

const Recipe = (props) => {
  return <div className={style.recipe}>
            <div className={style.imagediv}> <img className={style.foodimg} src={props.image} alt=""></img> </div>
            <div></div><h1>{props.title}</h1>
            <p>Calories:{props.calories}</p>




  </div>;
};
export default Recipe;
